class Solution {
    public long maximumValueSum(int[][] board) {
        int[][]mat = board ; 

        int m = mat.length , n = mat[0].length ; 
        int[][]max = new int[m][6] ; 

        for(int i=0 ; i<m ; i++){
            int[] arr = max[i] ; 
            PriorityQueue<int[]> pq = new PriorityQueue<>((a,b)->{
                return b[1]-a[1] ; 
            }) ; 
            for(int j =0 ; j<n ; j++){
                pq.add(new int[]{j , mat[i][j]}) ; 
            }
            int ct = 0 ;
            while(ct<3){
                int[] p = pq.poll() ; 
                arr[ct] = p[1] ; 
                arr[ct+3] = p[0] ; 
                ct++ ; 
            }
        }

        long ans = Long.MIN_VALUE ; 
        for(int i=0 ; i<m ; i++){
            for(int j=i+1 ; j<m ; j++){
                for(int k = j+1 ; k<m ; k++){
                    for(int l=3 ; l<6 ; l++){
                        for(int o =3 ; o<6 ; o++ ){
                            for(int p = 3 ; p<6 ; p++){
                                int [] a1 = max[i] ; 
                                int []a2 = max[j] ; 
                                int []a3 = max[k] ; 

                                long ans_ = (long)a1[l-3]+(long)a2[o-3]+(long)a3[p-3] ; 
                                if(a1[l]!=a2[o] && a1[l]!=a3[p] && a2[o]!=a3[p]) ans = Math.max(ans , ans_) ; 
                            }
                        }
                    } 
                }
            }
        }
        return ans ;
    }
}
